import React, { Component } from "react";

export default class Header extends Component {
  render() {
    const anchor = document.querySelector('#bio')
    anchor.scrollIntoView({ behavior: 'smooth', block: 'center' })
    return (
      <div>
        <span className="gothic">
        <a href="#bio">
          <h1>Bobby Nixon</h1>
          </a>
        </span>
      </div>
    );
  }
}
